function App() {

  const numberCreate = () => {
    const numbers = [];
    for(let i = 0; i < 10; i++)
      {
        numbers.push(
          <button>{i}</button>
        )
      }
  }

  return (
    <div className="App">
      <div className="calculator">
      {/* Start Display */}
        <div className="display">
          <span>(0)</span> 0
        </div>
      {/* End Display */}

      {/* Start Operators */}
        <div className="operators">
          <button>+</button>
          <button>-</button>
          <button>x</button>
          <button>:</button>

          <button>DEL</button>
        </div>
      {/* End Operators */}

      {/* Start Number */}
        <div className="number">
          <button>0</button>
          <button>.</button>
          <button>=</button>
        </div>
      {/* End Number */}

      </div>
    </div>
  );
}

export default App;
